import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function Feed() {
  const [scrapData, setScrapData] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchScrapData = async () => {
      try {
        const res = await axios.get('http://localhost:4000/scrap-pages'); // Update endpoint if necessary
        setScrapData(res.data); // Assuming the response contains an array of scrapbook data
      } catch (err) {
        console.error('Error fetching scrapbook data:', err);
        setError('Failed to load scrapbook data.');
      }
    };

    fetchScrapData();
  }, []);

  // Function to convert Buffer to Base64 string
  const bufferToBase64 = (bufferObj) => {
    const uint8Array = new Uint8Array(bufferObj.data); // Convert buffer to Uint8Array
    const base64String = btoa(
      uint8Array.reduce((data, byte) => data + String.fromCharCode(byte), '')
    );
    return `data:image/jpeg;base64,${base64String}`; // Adjust MIME type if necessary
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>Scrapbook Pages</h1>

      {/* Error Message */}
      {error && (
        <div style={{ color: 'red', marginBottom: '10px' }}>
          {error}
        </div>
      )}

      {/* Render Scrapbook Pages */}
      <div
        style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fill, minmax(200px, 1fr))',
          gap: '20px',
        }}
      >
        {scrapData.map((page, index) => (
          <div
            key={index}
            style={{
              border: '1px solid #ccc',
              borderRadius: '10px',
              padding: '10px',
              backgroundColor: page.color || '#f9f9f9',
            }}
          >
            <h3>{page.name}</h3>
            <p>{page.description}</p>

            {/* Render Images */}
            {page.binaryImages && page.binaryImages.length > 0 ? (
              <div
                style={{
                  display: 'grid',
                  gridTemplateColumns: 'repeat(auto-fill, minmax(100px, 1fr))',
                  gap: '10px',
                }}
              >
                {page.binaryImages.map((image, imgIndex) => {
                  const imageSrc = bufferToBase64(image);

                  return (
                    <img
                      key={imgIndex}
                      src={imageSrc}
                      alt={`Scrapbook ${imgIndex}`}
                      style={{
                        width: '150px',
                        height: '150px',
                        objectFit: 'cover',
                      }}
                    />
                  );
                })}
              </div>
            ) : (
              <p>No images available</p>
            )}

            {/* Stickers Section */}
            {page.stickers && page.stickers.length > 0 && (
              <div>
                <h4>Stickers:</h4>
                <ul>
                  {page.stickers.map((sticker, stickerIndex) => (
                    <li key={stickerIndex}>
                      Type: {sticker.stickerType}, Positions:{' '}
                      {sticker.position.map((pos, posIndex) => (
                        <span key={posIndex}>
                          ({pos.x}, {pos.y}){' '}
                        </span>
                      ))}
                    </li>
                  ))}
                </ul>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}
